  `purchases-index` tinyint(1) NOT NULL,
  `purchases-add` tinyint(1) NOT NULL,
  `purchases-edit` tinyint(1) NOT NULL,
  `purchases-delete` tinyint(1) NOT NULL,
  `auth-index` tinyint(1) NOT NULL,
  `auth-create_user` tinyint(1) NOT NULL,
